import P from 'prop-types';

export const Button = ({ children, onButtonClick }) => {
  return <button onClick={onButtonClick}>{children}</button>;
};

Button.prototype = {
  children: P.node.isRequired,
  onButtonClick: P.func.isRequired,
};
